import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';



function Navigationbar() {
    const handleSelect = (eventKey) => alert(`selected ${eventKey}`);
    return (
        <Navbar expand="lg" className="bg-body-tertiary main-nav" bg="primary" data-bs-theme="dark"  fixed='top'>
            <Container className='nav-sub-container'>
                <Navbar.Brand href="#home">Newssie</Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="ms-auto" variant="pills" activeKey="1" onSelect={handleSelect}>
                        <Nav.Link href="/app" className='nav-link-a' eventKey="1">
                        <NavLink to='/app' activeStyle>
                        Home
          </NavLink></Nav.Link>
                        <Nav.Link href="/top" className='nav-link-a' eventKey="2">Top</Nav.Link>
                        <Nav.Link href="/trending" className='nav-link-a' eventKey="3">Trending</Nav.Link>
                        <Nav.Link href="/science" className='nav-link-a' eventKey="4">Science</Nav.Link>
                        <Nav.Link href="/entertainment" className='nav-link-a' eventKey="5">Entertainment</Nav.Link>
                        <Nav.Link href="/spoers" className='nav-link-a' eventKey="6" style={{marginRight:'0px !important'}}>Sports</Nav.Link>
                        {/*<NavDropdown title="Dropdown" id="basic-nav-dropdown">
                            <NavDropdown.Item href="#action/3.1" className='nav-link-a'>Action</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.2" className='nav-link-a'>
                Another action
              </NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3" className='nav-link-a'>Something</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.4" className='nav-link-a'>
                Separated link
              </NavDropdown.Item>
  </NavDropdown>*/}
                    </Nav>
                </Navbar.Collapse>
            </Container>
        </Navbar>
    );
}

export default Navigationbar;
